import { useContext } from 'react';
import { useHistory } from 'react-router-dom';
import { Button, Image, Row } from 'react-bootstrap';
import { ErrorContext } from '../../context/errorContext';
import imageNotFound from '../../assets/images/chorando.svg';

const ErrorScreen = () => {
  const errorContext = useContext(ErrorContext);
  const history = useHistory();

  const handleHome = ({ screenName = '/' }) => {
    errorContext.setError(false);
    history.replace(screenName);
  };

  return (
    <div className="min-vhdl circular-indicator">
      <div>
        <Image className="w-25" src={imageNotFound} />
        <h2>Ops, algo deu errodo</h2>
        <Row className="justify-content-around pt-5">
          <Button onClick={handleHome}>Home</Button>
          <Button onClick={handleHome}>Recarregar</Button>
        </Row>
      </div>
    </div>
  );
};

export { ErrorScreen };
